$customer=(array) json_decode($appformD['customer_data']); 
$num = $appformD['loan_amt'];
$word =  convertNumberToWord("$num");
   
function convertNumberToWord($num = false)
{
    $num = str_replace(array(',', ' '), '' , trim($num));
    if(! $num) {
        return false;
    }
    $num = (int) $num;
    $words = array();
    $list1 = array('', 
        'Un',
        'Deux', 
        'Trois', 
        'Quatre', 
        'Cinq', 
        'Six', 
        'Sept', 
        'Huit', 
        'Neuf', 
        'Dix', 
        'onze',
        'douze', 
        'treize', 
        'quatorze', 
        'quinze', 
        'seize', 
        'Dix-sept', 
        'Dix-huit', 
        'Dix-neuf'
    );
    $list2 = array('', 
        'ten', 
        'vingt', 
        'trente', 
        'quarante', 
        'cinquante', 
        'soixante', 
        'soixante-dix', 
        'quatre-vingt',          
        'quatre-vingt dix',
        'cent');
    $list3 = array('', 'mille', 'million', 'billion', 'trillion', 'quadrillion', 'quintillion', 'sextillion', 'septillion',
        'octillion', 'nonillion', 'decillion', 'undecillion', 'duodecillion', 'tredecillion', 'quattuordecillion',
        'quindecillion', 'sexdecillion', 'septendecillion', 'octodecillion', 'novemdecillion', 'vigintillion'
    );
    $num_length = strlen($num);
    $levels = (int) (($num_length + 2) / 3);
    $max_length = $levels * 3;
    $num = substr('00' . $num, -$max_length);
    $num_levels = str_split($num, 3);
    for ($i = 0; $i < count($num_levels); $i++) {
        $levels--;
        $hundreds = (int) ($num_levels[$i] / 100);
        $hundreds = ($hundreds ? ' ' . $list1[$hundreds] . ' cent' . ' ' : '');
        $tens = (int) ($num_levels[$i] % 100);
        $singles = '';
        if ( $tens < 20 ) {
            $tens = ($tens ? ' ' . $list1[$tens] . ' ' : '' );
        } else {
            $tens = (int)($tens / 10);
            $tens = ' ' . $list2[$tens] . ' ';
            $singles = (int) ($num_levels[$i] % 10);
            $singles = ' ' . $list1[$singles] . ' ';
        }
        $words[] = $hundreds . $tens . $singles . ( ( $levels && ( int ) ( $num_levels[$i] ) ) ? ' ' . $list3[$levels] . ' ' : '' );
    } //end for loop
    $commas = count($words);
    if ($commas > 1) {
        $commas = $commas - 1;
    }
    return implode(' ', $words);
}
